dict.string:
readonly cache="${alfred_workflow_cache}/cache.json"
mkdir -p "$(dirname "${cache}")"

IFS=$'\n' read -d '' -rA dict_array < <(find '/Applications' "${HOME}/Applications" '/System/Applications' '/System/Cryptexes/App/System/Applications' '/System/Library/CoreServices/' '/System/Library/ScriptingAdditions' '/System/Library/ScriptingDefinitions' '/System/Library/PrivateFrameworks' -name '*.sdef' 2> /dev/null | grep 'Contents/Resources')

osascript -l JavaScript -e '
  function run(argv) {
    return JSON.stringify({
      "items": argv.map(dict => {
        const app_path = $(dict).stringByDeletingLastPathComponent.stringByDeletingLastPathComponent.stringByDeletingLastPathComponent.js

        return {
          "uid": dict,
          "type": "file",
          "title": $(app_path).lastPathComponent.stringByDeletingPathExtension.js,
          "subtitle": dict,
          "icon": { "path": app_path, "type": "fileicon" },
          "arg": dict
        }})
      })
    }
' "${dict_array[@]}" > "${cache}"
